export default "/* eslint-disable jsx-a11y/accessible-emoji */\nimport React from \"react\";\nimport styles from \"./OtherFinalForumSimple.module.scss\";\nimport { Form, Field } from \"react-final-form\";\n\nconst sleep = (ms) => new Promise((resolve) => setTimeout(resolve, ms));\n\nconst onSubmit = async (values) => {\n  await sleep(300);\n  window.alert(JSON.stringify(values, 0, 2));\n};\n\nexport default (props) => {\n  let formData = {\n    ...props,\n    toppings: [props.toppings],\n    sauces: [props.ketchup ? \"ketchup\" : null,props.mustard ? \"mustard\" : null,props.mayonnaise ? \"mayonnaise\" : null,props.guacamole ? \"guacamole\" : null,],\n  };\n  delete formData.height;\n  if (!props.toppings) delete formData.toppings;\n  if (!props.ketchup && !props.mustard && !props.mayonnaise && !props.guacamole) delete formData.sauces;\n\n  return (\n    <div className={styles.wrapper}>\n      <div className={styles.title}>React Final Form - Simple Example</div>\n      <a\n        href=\"https://final-form.org/react\"\n        target=\"_blank\"\n        rel=\"noopener noreferrer\"\n      >\n        Read Docs\n      </a>\n      <Form\n        onSubmit={onSubmit}\n        initialValues={{\n          ...formData,\n        }}\n        render={({ handleSubmit, form, submitting, pristine, values }) => (\n          <form onSubmit={handleSubmit} className={styles.form}>\n            <div>\n              <label>First Name</label>\n              <Field\n                name=\"firstName\"\n                component=\"input\"\n                type=\"text\"\n                placeholder=\"First Name\"\n              />\n            </div>\n            <div>\n              <label>Last Name</label>\n              <Field\n                name=\"lastName\"\n                component=\"input\"\n                type=\"text\"\n                placeholder=\"Last Name\"\n              />\n            </div>\n            <div>\n              <label>Employed</label>\n              <Field name=\"employed\" component=\"input\" type=\"checkbox\" />\n            </div>\n            <div>\n              <label>Favorite Color</label>\n              <Field name=\"favoriteColor\" component=\"select\">\n                <option />\n                <option value=\"#ff0000\">‚ù§Ô∏è Red</option>\n                <option value=\"#00ff00\">üíö Green</option>\n                <option value=\"#0000ff\">üíô Blue</option>\n              </Field>\n            </div>\n            <div>\n              <label>Toppings</label>\n              <Field name=\"toppings\" component=\"select\" multiple>\n                <option value=\"chicken\">üêì Chicken</option>\n                <option value=\"ham\">üê∑ Ham</option>\n                <option value=\"mushrooms\">üçÑ Mushrooms</option>\n                <option value=\"cheese\">üßÄ Cheese</option>\n                <option value=\"tuna\">üêü Tuna</option>\n                <option value=\"pineapple\">üçç Pineapple</option>\n              </Field>\n            </div>\n            <div>\n              <label>Sauces</label>\n              <div className={styles.labels}>\n                <label>\n                  <Field\n                    name=\"sauces\"\n                    component=\"input\"\n                    type=\"checkbox\"\n                    value=\"ketchup\"\n                  />{\" \"}\n                  Ketchup\n                </label>\n                <label>\n                  <Field\n                    name=\"sauces\"\n                    component=\"input\"\n                    type=\"checkbox\"\n                    value=\"mustard\"\n                  />{\" \"}\n                  Mustard\n                </label>\n                <label>\n                  <Field\n                    name=\"sauces\"\n                    component=\"input\"\n                    type=\"checkbox\"\n                    value=\"mayonnaise\"\n                  />{\" \"}\n                  Mayonnaise\n                </label>\n                <label>\n                  <Field\n                    name=\"sauces\"\n                    component=\"input\"\n                    type=\"checkbox\"\n                    value=\"guacamole\"\n                  />{\" \"}\n                  Guacamole ü•ë\n                </label>\n              </div>\n            </div>\n            <div>\n              <label>Best Stooge</label>\n              <div className={styles.labels}>\n                <label>\n                  <Field\n                    name=\"stooge\"\n                    component=\"input\"\n                    type=\"radio\"\n                    value=\"larry\"\n                  />{\" \"}\n                  Larry\n                </label>\n                <label>\n                  <Field\n                    name=\"stooge\"\n                    component=\"input\"\n                    type=\"radio\"\n                    value=\"moe\"\n                  />{\" \"}\n                  Moe\n                </label>\n                <label>\n                  <Field\n                    name=\"stooge\"\n                    component=\"input\"\n                    type=\"radio\"\n                    value=\"curly\"\n                  />{\" \"}\n                  Curly\n                </label>\n              </div>\n            </div>\n            <div>\n              <label>Notes</label>\n              <Field name=\"notes\" component=\"textarea\" placeholder=\"Notes\" />\n            </div>\n            <div className={styles.buttons}>\n              <button type=\"submit\" disabled={submitting || pristine}>\n                Submit\n              </button>\n              <button\n                type=\"button\"\n                onClick={form.reset}\n                disabled={submitting || pristine}\n              >\n                Reset\n              </button>\n            </div>\n            <pre>{JSON.stringify(values, 0, 2)}</pre>\n          </form>\n        )}\n      />\n    </div>\n  );\n};\n";